    this.state ={
      foo: "bar",
      resumeData: {}
    };
    ReactGA.initialize("UA-110570651-1");
    ReactGA.pageview(window.location.pathname);
  }

  getResumeData(){
    $.ajax({
      url:"./resumeData.json",
      dataType: "json",
      cache:false,
      success: function(data) {
        this.setState({
          resumeData:data
